import React, { Component } from "react";
import Counter1 from "./counter";

class Counters extends Component {
  state = {};
  render() {
    return (
      <div>
        <Counter1 />
        <Counter1 />
        <Counter1 />
      </div>
    );
  }
}

export default Counters;
